using System;
using System.Collections.ObjectModel;
using System.Collections.Specialized;
using System.Windows.Input;

using CoralClient.DbContext;
using CoralClient.Model;
using CoralClient.Services;

using Microsoft.Extensions.DependencyInjection;

using Xamarin.Forms;

namespace CoralClient.ViewModel
{
    public class MainViewModel : BaseViewModel
    {
        private readonly ServerProfileContext _serverProfilesCtx;

        public MainViewModel()
        {
            _serverProfilesCtx = Dependencies.ServiceProvider
                .GetRequiredService<ServerProfileContext>();

            ServerProfiles = new ObservableCollection<ServerProfile>(_serverProfilesCtx.ServerProfiles);
            ServerProfiles.CollectionChanged += (sender, args) =>
            {
                switch (args.Action)
                {
                    case NotifyCollectionChangedAction.Add:
                        foreach (var profile in args.NewItems)
                        {
                            _serverProfilesCtx.ServerProfiles.Add((ServerProfile)profile);
                        }
                        break;
                    case NotifyCollectionChangedAction.Remove:
                        foreach (var profile in args.NewItems)
                        {
                            _serverProfilesCtx.ServerProfiles.Remove((ServerProfile)profile);
                        }
                        break;
                    case NotifyCollectionChangedAction.Move:
                        break;
                    case NotifyCollectionChangedAction.Replace:
                        break;
                    case NotifyCollectionChangedAction.Reset:
                        break;
                    default:
                        throw new ArgumentOutOfRangeException();
                }
            };
#if DEBUG
            AddDebugServers();
#endif
        }

        private void AddDebugServers()
        {
            ServerProfiles.Clear();

            foreach (var profile in new[]
                     {
                         new ServerProfile
                         {
                             Uri = "pi.hole", MinecraftPort = 20000, RconPort = 9112, Password = "Test",
                             ImageB64 =
                                 ""
                         },
                         new ServerProfile {Uri = "pi.hole"},
                         new ServerProfile {Uri = "pi.hole", MinecraftPort = 25561, RconPort = 9332, Password = ""},
                         new ServerProfile
                             {Uri = "pi.hole", MinecraftPort = 11111, RconPort = 25560, Password = "Test"},
                         new ServerProfile {Uri = "pi.hole", RconPort = 25561, Password = "Test"},
                     })
            {

                ServerProfiles.Add(profile);
            }
        }

        public ObservableCollection<ServerProfile> ServerProfiles { get; set; }

        public ICommand NewServerCommand => new Command(() =>
            Application.Current.MainPage.Navigation.PushAsync(new NewServerPage()));

        public ICommand ViewServerCommand => new Command(() =>
            Application.Current.MainPage.Navigation.PushAsync(new ViewServerPage()));
    }
}
